from collections import defaultdict


class Solution:
    def gcd(self, a, b):
        if b ==0:
            return a
        return self.gcd(b, a % b)

    def hasGroupsSizeX(self, deck):
        if len(deck) < 2:
            return False
        groups = defaultdict(int)
        for d in deck:
            groups[d] += 1
        if all(size == groups[deck[0]] for size in groups.values()):
            return True

        nums = [sz for sz in groups.values()]
        nums.sort()
        div = nums[0]
        for i in range(1, len(nums)):
            q = self.gcd(div, nums[i])
            if q > 1 and all(size % q == 0 for size in nums):
                return True
        return False


